INSERT INTO `events` (`eid`, `name`, `date`, `time`, `host`, `prize`, `description`, `volunteer`) VALUES
(1, 'Volunteer Meeting', '2013-02-18', '19:00:00', 'Sean Burke', 0, 'Volunteers must attend this event!', 'stburke'),
(2, 'Dean''s Breakfast', '2013-02-19', '09:00:00', 'ESC', 0, 'Have breakfast with professors and faculty of the engineering department', 'stburke'),
(3, 'EngiTECH', '2013-02-20', '09:30:00', 'ESC', 0, 'Career fair for engineers. A great opportunity to network with peers as well as representatives from numerous companies.', 'stburke'),
(4, 'E-Week BBQ', '2013-02-21', '11:00:00', 'ESC', 0, 'Free BBQ at the Engineering Quad provided by UCI Dining and Catering.', 'stburke'),
(6, 'Broomball', '2013-02-22', '23:00:00', 'ESC', 0, 'After the Awards Banquet, come out and play Broomball with fellow engineers.', 'stburke'),
(7, 'Awards Banquet', '2013-02-22', '18:30:00', 'ESC', 0, 'Come to Doheny Beach (in the Student Center) to celebrate the top students, faculty members, and TA''s in the engineering department. Dinner will be provided.', 'stburke'),
(8, 'Student/Faculty Softball Game', '2013-02-23', '11:00:00', 'ESC', 0, 'Students and faculty will face off in a friendly, yet competitive, softball game at the Gabrielino Fields in Irvine.', 'stburke');
